import Colors from "./Colors";

const ChangedByPageStyle = {
    headerShown: true,
    headerTitle: "Filter By: Changed By",
    headerTintColor: Colors.whiteColor,
    headerStyle: {
      backgroundColor: Colors.pageBgColor,
    }
}

export default ChangedByPageStyle
